INSERT INTO `degreework` VALUES (1,'BAPI','Analysis of Market Trends in the Tech Industry','Business Analytics','This degree work analyzes the latest market trends in the technology industry, focusing on emerging technologies and their impact on business strategies.','2023-05-10',1),(2,'Thesis','Exploring Renewable Energy Solutions','Environmental Science','This thesis explores various renewable energy solutions and their potential to mitigate climate change. It includes case studies and theoretical frameworks.','2023-05-12',2),(3,'Degree Work','Impact of Social Media on Consumer Behavior','Marketing','This degree work examines the influence of social media platforms on consumer behavior and purchasing decisions. It includes surveys and data analysis.','2023-05-14',3),(4,'Other','Exploration of Artificial Intelligence Applications','Computer Science','This project explores different applications of artificial intelligence, including machine learning algorithms and neural networks.','2023-05-16',4),(5,'BAPI','Innovations in Healthcare Technology','Health Informatics','This BAPI project investigates recent innovations in healthcare technology, such as telemedicine platforms and wearable devices for monitoring health metrics.','2023-05-18',5),(6,'Thesis','Urban Planning Strategies for Sustainable Cities','Urban Planning','This thesis proposes urban planning strategies aimed at creating more sustainable and livable cities. It includes case studies and policy recommendations.','2023-05-20',6),(7,'Degree Work','Revolutionizing Education through Technology','Education Technology','This degree work explores the use of technology in transforming traditional educational practices. It includes the development of e-learning platforms and educational apps.','2023-05-22',7),(8,'Other','Exploring Cultural Impact on Consumer Preferences','Anthropology','This project investigates how cultural factors influence consumer preferences and purchasing behavior. It includes ethnographic research and qualitative analysis.','2023-05-24',8),(9,'BAPI','Analysis of Financial Markets Volatility','Finance','This BAPI project analyzes the volatility of financial markets, focusing on factors such as economic indicators and geopolitical events. It includes statistical modeling and risk assessment.','2023-05-26',9),(10,'Thesis','Advancements in Biomedical Engineering','Biomedical Engineering','This thesis explores recent advancements in biomedical engineering, including tissue engineering techniques and medical device innovations.','2023-05-28',10),(11,'Degree Work','Sustainable Agriculture Practices','Agriculture','This degree work examines sustainable agriculture practices aimed at improving food security and environmental sustainability. It includes case studies and agricultural experiments.','2023-05-30',11),(12,'Other','Exploration of Quantum Computing','Computer Science','This project explores the principles and applications of quantum computing, including quantum algorithms and quantum cryptography.','2023-06-01',12),(13,'BAPI','Analysis of Cryptocurrency Markets','Finance','This BAPI project analyzes cryptocurrency markets, including price trends and trading volumes. It includes data visualization and statistical analysis.','2023-06-03',13),(14,'Thesis','Implications of Climate Change on Biodiversity','Environmental Science','This thesis examines the implications of climate change on global biodiversity, including species extinction rates and habitat loss.','2023-06-05',14),(15,'Degree Work','Augmented Reality Applications in Education','Education Technology','This degree work explores the use of augmented reality technologies in enhancing educational experiences. It includes the development of AR learning modules.','2023-06-07',15),(16,'Other','Analysis of Cybersecurity Threats','Cybersecurity','This project analyzes cybersecurity threats facing organizations and individuals, including malware attacks and data breaches. It includes risk assessments and