ncluding solar, wind, and hydroelectric power. It includes feasibility studies and cost-benefit analyses.','2023-06-25',24),(25,'BAPI','Analysis of Supply Chain Management Practices','Supply Chain Management','This BAPI project analyzes supply chain management practices, including inventory management and logistics optimization. It includes process mapping and performance metrics evaluation.','2023-06-27',25),(26,'Thesis','Exploring Digital Marketing Strategies','Digital Marketing','This thesis examines digital marketing strategies used by businesses to reach their target audiences online. It includes case studies and marketing campaign analyses.','2023-06-29',26),(27,'Degree Work','Innovations in Renewable Energy Technologies','Renewable Energy Engineering','This degree work explores innovations in renewable energy technologies, including solar panels and wind turbines. It includes prototype development and performance testing.','2023-07-01',27);
